import React, { useState, useContext } from "react";
import { Link } from "react-router-dom";
import Login from "../components/login";
import Logout from "../components/logout";
import { UserContext } from "../context/UserContext";
import App from "../App.js";

const Navbar = props => {
  console.log(App);

  const [userContext, setUserContext] = useContext(UserContext);

/*
return (
  <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
    <Link className="navbar-brand" to="">Top 100 Movies</Link>
    <ul className="navbar-nav mr-auto">
      <li className="nav-item">
        <a className="nav-link" href="/movies">Movies</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="/profiles">Profiles</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="/profile">Profile</a>
      </li>
      {
        userContext.token != undefined && userContext.token != null ?
        <li className="nav-item">
          <a className="nav-link" href="/logout">Logout</a>
        </li>
        :
        <li className="nav-item">
          <a className="nav-link" href="/login">Login</a>
        </li>

        }
      }
    </ul>
  </nav>
);
*/

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <Link className="navbar-brand" to="">Top 100 Movies</Link>
      <ul className="navbar-nav mr-auto">
        <li className="nav-item">
          <Link className="nav-link" to="/movies" onClick={App.fetchUserDetails()}>Movies</Link>
        </li>
        <li className="nav-item">
          <Link className="nav-link" to="/profiles">Profiles</Link>
        </li>
        <li className="nav-item">
          <Link className="nav-link" to="/profile">Profile</Link>
        </li>
        {
          userContext.token != undefined && userContext.token != null ?
          <li className="nav-item">
            <Link className="nav-link" to="/logout">Logout</Link>
          </li>
          :
          <li className="nav-item">
            <Link className="nav-link" to="/login">Login</Link>
          </li>

          }
        }
      </ul>
    </nav>
  );

};

export default Navbar;
